import React from "react";
import ItemList from "../ItemList";
import { withData, withSwapiService } from "../hoc-helper";
import SwapiService from "../../services/SwapiService";

const withChildFunction = (Wrapped, fn) => {
  return props => {
    console.log("withChildFunction props", props);

    return <Wrapped {...props}>{fn}</Wrapped>;
  };
};
const renderName = ({ name }) => <span>{name}</span>;

const renderNameAndModel = ({ name, model }) => (
  <span>
    {name} ({model})
  </span>
);
const mapPersonMethodToProps = (swapiService) =>{
  return{
    getData:swapiService.getAllPeople,
    getImageUrl:swapiService.getPersonImage
  }
}
const mapPlanetMethodToProps = (swapiService) =>{
  return{
    getData:swapiService.getAllPlanets,
    getImageUrl:swapiService.getPlanetImage
  }
}

const PersonList = withSwapiService(withData(withChildFunction(ItemList, renderName)),mapPersonMethodToProps);
const PlanetList = withData(withChildFunction(ItemList, renderName),mapPlanetMethodToProps);
const StarshipList = withData(withChildFunction(ItemList, renderNameAndModel));
console.log(PersonList);

export { PersonList, PlanetList, StarshipList };
